-- ----------------------------
--  Table structure for `payment`
-- ----------------------------
DROP TABLE IF EXISTS `payment`;
CREATE TABLE `payment` (
  `id` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'id',
  `oid` text COLLATE utf8_unicode_ci NOT NULL COMMENT '订单id, 多个以英文逗号隔开',
  `type` tinyint(1) NOT NULL DEFAULT '1' COMMENT '支付单类型: 1普通支付单',
  `title` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT '订单名称',
  `description` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '描述信息',
  `url` text COLLATE utf8_unicode_ci COMMENT '商品展示url',
  `amount` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '支付总额(分)',
  `mode` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '支付方式',
  `tid` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '第三方支付端流水号',
  `expired_at` int(11) NOT NULL DEFAULT '0' COMMENT '过期时间',
  `completed_at` int(11) NOT NULL DEFAULT '0' COMMENT '支付完成时间',
  `status` tinyint(4) DEFAULT '1' COMMENT '1:正常 -1删除',
  `created_at` int(11) NOT NULL COMMENT '创建时间',
  `updated_at` int(11) NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='支付单';

