-- ----------------------------
--  Table structure for `payment_notify`
-- ----------------------------
DROP TABLE IF EXISTS `payment_notify`;
CREATE TABLE `payment_notify` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '通知记录id',
  `pid` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '支付单id',
  `mode` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '第三方支付类型',
  `tid` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '第三方支付端流水号',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '支付结果: 0失败, 1成功',
  `verified` tinyint(1) NOT NULL DEFAULT '0' COMMENT '验证结果: 0失败, 1成功',
  `data` text COLLATE utf8_unicode_ci NOT NULL COMMENT '消息通知数据(json)',
  `created_at` int(11) NOT NULL COMMENT '接收时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2382 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='第三方支付消息通知记录';

